`,stats:{STR:16,DEX:14,CON:14,INT:6,WIS:12,CHA:7}},{id:"8mqse552j",name:"Archmage",hp:99,AC:12,type:"humanoid",speed:30,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:["INT +9","WIS +6"],skills:["Arcana +13","History +13"],senses:["Passive Perception 12"],challenge:"12 (8,400 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/167/1000/1000/636252760213195530.jpeg",size:"medium",alignment:"any",isPlayer:!1,notes:`
