`,stats:{STR:25,DEX:10,CON:20,INT:10,WIS:12,CHA:12}},{id:"5fmxvbs7t",name:"Dretch",hp:18,AC:11,type:"fiend",speed:20,speedSwim:10,speedFly:0,immunities:["Poison","Poisoned"],resistances:["Cold","Fire","Lightning"],vulnerabilities:[],savingThrows:[],skills:[],senses:["Darkvision 60 ft.","Passive Perception 9"],challenge:"1/4 (50 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/293/1000/1000/636252771253285096.jpeg",size:"small",alignment:"chaotic evil",isPlayer:!1,notes:`
