`,stats:{STR:10,DEX:14,CON:10,INT:11,WIS:11,CHA:12}},{id:"c88v8ydic",name:"Druid",hp:27,AC:11,type:"humanoid",speed:30,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Medicine +4","Nature +3","Perception +4"],senses:["Passive Perception 14"],challenge:"2 (450 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/299/1000/1000/636252771583275655.jpeg",size:"medium",alignment:"any",isPlayer:!1,notes:`
