`,stats:{STR:20,DEX:8,CON:20,INT:5,WIS:10,CHA:5}},{id:"ab5hgylec",name:"Efreeti",hp:200,AC:17,type:"elemental",speed:40,speedSwim:10,speedFly:60,immunities:["Fire"],resistances:[],vulnerabilities:[],savingThrows:["INT +7","WIS +6","CHA +7"],skills:[],senses:["Darkvision 120 ft.","Passive Perception 12"],challenge:"11 (7,200 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/325/1000/1000/636252775714332067.jpeg",size:"large",alignment:"lawful evil",isPlayer:!1,notes:`
