`,stats:{STR:16,DEX:10,CON:12,INT:2,WIS:10,CHA:6}},{id:"mttk7zre8",name:"Erinyes",hp:153,AC:18,type:"fiend",speed:30,speedSwim:10,speedFly:60,immunities:["Fire","Poison","Poisoned"],resistances:["Cold; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks that aren't Silvered"],vulnerabilities:[],savingThrows:["DEX +7","CON +8","WIS +6","CHA +8"],skills:[],senses:["Truesight 120 ft.","Passive Perception 12"],challenge:"12 (8,400 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/329/1000/1000/636252776041158657.jpeg",size:"medium",alignment:"lawful evil",isPlayer:!1,notes:`
