`,stats:{STR:4,DEX:18,CON:11,INT:2,WIS:12,CHA:5}},{id:"iy9tcs5pk",name:"Flying Sword",hp:17,AC:17,type:"construct",speed:0,speedSwim:10,speedFly:50,immunities:["Poison","Psychic","Blinded","Charmed","Deafened","Frightened","Paralyzed","Petrified","Poisoned"],resistances:[],vulnerabilities:[],savingThrows:["DEX +4"],skills:[],senses:["Blindsight 60 ft.","Passive Perception 7"],challenge:"1/4 (50 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/77/599/1000/1000/636473151106171093.png",size:"small",alignment:"unaligned",isPlayer:!1,notes:`
