`,stats:{STR:11,DEX:13,CON:12,INT:2,WIS:12,CHA:5}},{id:"mktpjigsv",name:"Ice Devil",hp:180,AC:18,type:"fiend",speed:40,speedSwim:10,speedFly:0,immunities:["Cold","Fire","Poison","Poisoned"],resistances:["Bludgeoning","Piercing","and Slashing from Nonmagical Attacks that aren't Silvered"],vulnerabilities:[],savingThrows:["DEX +7","CON +9","WIS +7","CHA +9"],skills:[],senses:["Blindsight 60 ft.","Darkvision 120 ft.","Passive Perception 12"],challenge:"14 (11,500 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/353/315/315/636252777966974765.jpeg",size:"large",alignment:"lawful evil",isPlayer:!1,notes:`
