`,stats:{STR:7,DEX:13,CON:10,INT:9,WIS:11,CHA:12}},{id:"2pal0c9yn",name:"Imp",hp:10,AC:13,type:"fiend",speed:20,speedSwim:10,speedFly:40,immunities:["Fire","Poison","Poisoned"],resistances:["Cold; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks that aren't Silvered"],vulnerabilities:[],savingThrows:[],skills:["Deception +4","Insight +3","Persuasion +4","Stealth +5"],senses:["Darkvision 120 ft.","Passive Perception 11"],challenge:"1 (200 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/361/315/315/636252778560366227.jpeg",size:"tiny",alignment:"lawful evil",isPlayer:!1,notes:`
