`,stats:{STR:6,DEX:17,CON:13,INT:11,WIS:12,CHA:14}},{id:"1qpmqjwnj",name:"Invisible Stalker",hp:104,AC:14,type:"elemental",speed:50,speedSwim:10,speedFly:50,immunities:["Poison","Exhaustion","Grappled","Paralyzed","Petrified","Poisoned","Prone","Restrained","Unconscious"],resistances:["Bludgeoning","Piercing","and Slashing from Nonmagical Attacks"],vulnerabilities:[],savingThrows:[],skills:["Perception +8","Stealth +10"],senses:["Darkvision 60 ft.","Passive Perception 18"],challenge:"6 (2,300 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/367/315/315/636252779159282339.jpeg",size:"medium",alignment:"neutral",isPlayer:!1,notes:`
