`,stats:{STR:10,DEX:13,CON:12,INT:11,WIS:11,CHA:12}},{id:"1zz9z4xb4",name:"Merrow",hp:45,AC:13,type:"monstrosity",speed:10,speedSwim:40,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Darkvision 60 ft.","Passive Perception 10"],challenge:"2 (450 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/203/315/315/636252764097970952.jpeg",size:"large",alignment:"chaotic evil",isPlayer:!1,notes:`
