`,stats:{STR:18,DEX:11,CON:15,INT:6,WIS:8,CHA:5}},{id:"zlewp28zl",name:"Mule",hp:11,AC:10,type:"beast",speed:40,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Passive Perception 10"],challenge:"1/8 (25 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/attachments/2/648/beast.jpg",size:"medium",alignment:"unaligned",isPlayer:!1,notes:`
